import React      from 'react';
import styled from 'styled-components';
import { Button } from './Button';
import test       from '../Images/pizza.jpg';

const ProductSliderContainer =styled.div`
max-width:100%;
max-height: 200vh;
background-color: royalblue;
padding: 20% 20%;
`;

const ButtonWrapper =styled.div`
margin-left: 10%;
    margin-top: 18%;
`;

const ProductsSliderMenue = () => {
    return (
        <ProductSliderContainer>
        <div className = "container">
            <div className = "row">
                <div className = "col-sm">
                        <div class = "card" style = {{width: '18rem'}}>
                            <img src       = {test} class         = "card-img-top" alt = "" />
                                <div class     = "card-body">
                                    <h5  class     = "card-title">Card title</h5>
                                    <p   class     = "card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                                    <ButtonWrapper>
                                    <Button to = '/orderNow' primary = 'true'>Order Now</Button>
                                    </ButtonWrapper>
                                    
                                </div>
                        </div>
                </div>
            </div>
        </div>
        </ProductSliderContainer>
       
    );
};
export default ProductsSliderMenue
